import React from "react";
import {Chart} from 'primereact/chart';

export default function Pie1() {

  const data = {
    datasets: [
        {
            data: [300, 50],
            backgroundColor: [
                "#FF6384",
                "#36A2EB"
            ],
            hoverBackgroundColor: [
                "#FF6384",
                "#36A2EB"
            ]
        }]
    };
    return (
      <div>
      <Chart width="200" height="200" type="pie" data={data} />
  </div>
    );
  }
